import Link from 'next/link';

const Header = () => {
  return (
    <>
      <header>
        <nav>
          <ul style={linkStyle}>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/about"><a>About</a></Link></li>
            <li><Link href="/contact"><a>Contact</a></Link></li>
            <li><Link href="/tv-api"><a>Tv</a></Link></li>
          </ul>
        </nav>
      </header>
    </>
  );
};

const linkStyle = {
  display: 'flex',
  listStyle: 'none'
}

export default Header;
